import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import GlavniIzbornik from '../pages/GlavniIzbornik';
import LoginPage from '../pages/LoginPage';
import PopisBodova from '../pages/PopisBodova';
import PopisDivljaci from '../pages/PopisDivljaci';
import PopisLova from '../pages/PopisLova';
import PopisLovaca from '../pages/PopisLovaca';
import PopisOstrijela from '../pages/PopisOstrijela';
import RasporedAktivnosti from '../pages/RasporedAktivnosti';
import UnosBodova from '../pages/UnosBodova';
import UnosDivljaci from '../pages/UnosDivljaci';
import UnosLovaca from '../pages/UnosLovaca';
import UnosOstrijela from '../pages/UnosOstrijela';
import UnosRasporeda from '../pages/UnosRasporeda';

const Routes = () => {
    return (
        <Router>
            <Switch>
                <Route exact path="/" component={GlavniIzbornik} />
                <Route path="/login" component={LoginPage} />
                <Route path="/popis-bodova" component={PopisBodova} />
                <Route path="/popis-divljaci" component={PopisDivljaci} />
                <Route path="/popis-lova" component={PopisLova} />
                <Route path="/popis-lovaca" component={PopisLovaca} />
                <Route path="/popis-ostrijela" component={PopisOstrijela} />
                <Route path="/raspored-aktivnosti" component={RasporedAktivnosti} />
                <Route path="/unos-bodova" component={UnosBodova} />
                <Route path="/unos-divljaci" component={UnosDivljaci} />
                <Route path="/unos-lovaca" component={UnosLovaca} />
                <Route path="/unos-ostrijela" component={UnosOstrijela} />
                <Route path="/unos-rasporeda" component={UnosRasporeda} />
            </Switch>
        </Router>
    );
}

export default Routes;
